var galua = function() {
    // saves the drone position so it can return there later
    this.chkpt('galua');
    var x, y;
    // each block is 3x3.
    var w = 1;
    for(y = 0; y < 172; y++ ) {
        for(x = 0; x < 298; x++) {
            var h = galua_elevation[y][x];
            var b = galua_blocks[y][x];
            if(b == 0) {
                // water
                var h2 = w*4;
                var h1 = h - h2;
                if(h1 > 0) {
                    this.box(blocks.clay,w,h1,w)
                        .up(h1)
                        .box(blocks.water,w,h2,w)
                        .down(h1);
                } else {
                    this.box(blocks.water,w,h,w)
                }
            } else if(b == 1) {
                // grass-covered block
                var h2 = w;
                var h1 = h - h2;
                if(h1 > 0) {
                    this.box(blocks.dirt,w,h1,w)
                        .up(h1)
                        .box(blocks.grass,w,h2,w)
                        .down(h1);
                } else {
                    this.box(blocks.grass,w,h,w)
                }
            } else if(b >= 2) {
                // high grass-covered block
                var h3 = w;
                var h2 = w*3;
                var h1 = h - h2 - h3;
                if(h1 > 0) {
                    this.box(blocks.stone,w,h1,w)
                        .up(h1)
                        .box(blocks.dirt,w,h2,w)
                        .up(h2)
                        .box(blocks.grass,w,h3,w)
                        .down(h1+h2);
                } else {
                    this.box(blocks.grass,w,h,w)
                }
            }
            this.right(w);
        }
        this.left(x*w).fwd(w);
    }
    // return to where we started
    return this.move('galua');
};
// Okay this extends the drone object to include this fn
var Drone = require('../drone/drone').Drone;
Drone.extend('galua',galua);

